        public static void Swap<T>(ref T lhs, ref T rhs)
        {
            T t = lhs;
            lhs = rhs;
            rhs = t;
        }
        public static void MakeCircle(int x, int y, float r, ushort type)
        {
            int num = (int)(x - r);
            int num2 = (int)(y - r);
            int num3 = (int)(x + r);
            int num4 = (int)(y + r);
            for (int i = num; i < num3 + 1; i++)
            {
                for (int j = num2; j < num4 + 1; j++)
                {
                    if (Vector2.Distance(new Vector2(i, j), new Vector2(x, y)) <= r)
                    {
                        if (type == 65535)
                        {
                            Main.tile[i, j].active(false);
                            Main.tile[i, j].wall = (ushort)ModContent.WallType<Walls.TuhrtlBrickWallUnsafe>();
                        }
                        else
                        {
                            Main.tile[i, j].active(true);
                            Main.tile[i, j].type = type;
                            Main.tile[i, j].wall = (ushort)ModContent.WallType<Walls.TuhrtlBrickWallUnsafe>();
                            WorldGen.SquareTileFrame(i, j, true);
                        }
                    }
                }
            }
        }
        public static void BoreTunnel(int x0, int y0, int x1, int y1, float r, ushort type)
        {
            bool flag = Math.Abs(y1 - y0) > Math.Abs(x1 - x0);
            if (flag)
            {
                Swap<int>(ref x0, ref y0);
                Swap<int>(ref x1, ref y1);
            }
            if (x0 > x1)
            {
                Swap<int>(ref x0, ref x1);
                Swap<int>(ref y0, ref y1);
            }
            int num = x1 - x0;
            int num2 = Math.Abs(y1 - y0);
            int num3 = num / 2;
            int num4 = (y0 < y1) ? 1 : -1;
            int num5 = y0;
            for (int i = x0; i <= x1; i++)
            {
                if (flag)
                {
                    MakeCircle(num5, i, r, type);
                }
                else
                {
                    MakeCircle(i, num5, r, type);
                }
                num3 -= num2;
                if (num3 < 0)
                {
                    num5 += num4;
                    num3 += num;
                }
            }
        }

